import {createStore} from "redux";
const initialState = {
    jugadores: [{
        id: 1,
        nombre: "nasser",
    },{
        id: 2,
        nombre: "bruno",
    },{
        id:3,
        nombre: "fane"
    }
],
    titulares: [],
    suplentes: []
}
const reducer = (state = initialState, action ) => {
    return state 
}
export default createStore( reducer )
